  case 7:
    return semanticor->declVarParam();

  case 8:
    return semanticor->declVarParam1();

  case 9:
    return semanticor->firstParam();

  case 10:
    return semanticor->nextParam();

  case 11:
    return semanticor->declParam();

  case 12:
    return semanticor->declEmptyArrayInitializer();

  case 13:
    return semanticor->declArrayInitializer();

  case 14:
    return semanticor->firstVariableInitializer();

  case 15:
    return semanticor->nextVariableInitializer();

  case 16:
    return semanticor->declEmptyBlock();

  case 17:
    return semanticor->declBlock();

  case 18:
    return semanticor->firstBlockStatement();

  case 19:
    return semanticor->nextBlockStatement();

  case 20:
    return semanticor->declLocalVar();

  case 21:
    return semanticor->declEmptyStatement();

  case 22:
    return semanticor->declExpressionStatement();

  case 23:
    return semanticor->declIfStatement();

  case 24:
    return semanticor->declIfElseStatement();

  case 25:
    return semanticor->declWhileStatement();

  case 26:
    return semanticor->declForStatement();

  case 27:
    return semanticor->declEmptyForInit();

  case 28:
    return semanticor->declEmptyForCondition();

  case 29:
    return semanticor->declEmptyForUpdate();

  case 30:
    return semanticor->declBreakStatement();

  case 31:
    return semanticor->declContinueStatement();

  case 32:
