  case 33:
    return semanticor->declReturnWithExpression();

  case 34:
    return semanticor->declBinaryExpr();

  case 35:
    return semanticor->declPrefixExpression();

  case 36:
    return semanticor->declCastExpression();

  case 37:
    return semanticor->declParanExpression();

  case 38:
    return semanticor->declIdentifier();

  case 39:
    return semanticor->declArrayAccess();

  case 40:
    return semanticor->declMethodInvocation();

  case 41:
